import * as React from 'react';
import { styled, createTheme, ThemeProvider } from '@mui/material/styles';
import CssBaseline from '@mui/material/CssBaseline';
import MuiDrawer from '@mui/material/Drawer';
import Box from '@mui/material/Box';
import MuiAppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import List from '@mui/material/List';
import Typography from '@mui/material/Typography';
import Divider from '@mui/material/Divider';
import IconButton from '@mui/material/IconButton';
import Badge from '@mui/material/Badge';
import Container from '@mui/material/Container';
import Grid from '@mui/material/Grid';
import Paper from '@mui/material/Paper';
import Link from '@mui/material/Link';
import MenuIcon from '@mui/icons-material/Menu';
import LogoutIcon from '@mui/icons-material/Logout';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemText from '@mui/material/ListItemText';
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';

const drawerWidth = 300;

const mainListItems = (
    <React.Fragment>
        <ListItemButton>
            <Avatar sx={{ marginRight: '10px' }} src="" />
            <ListItemText primary="Luisa" />
        </ListItemButton>
        <Divider />
        <ListItemButton>
            <Avatar sx={{ marginRight: '10px' }} src="" />
            <ListItemText primary="Marta" />
        </ListItemButton>
        <Divider />
    </React.Fragment>
);


const Drawer = styled(MuiDrawer, { shouldForwardProp: (prop) => prop !== 'open' })(
    ({ theme }) => ({
        '& .MuiDrawer-paper': {
            position: 'relative',
            whiteSpace: 'nowrap',
            width: drawerWidth,
            boxSizing: 'border-box',
            [theme.breakpoints.up('sm')]: {
                width: drawerWidth,
            },
        },
    }),
);

// TODO remove, this demo shouldn't need to reset the theme.
const defaultTheme = createTheme();

export default function Chat() {
    const [open, setOpen] = React.useState(true);
    const toggleDrawer = () => {
        setOpen(!open);
    };

    return (
        <ThemeProvider theme={defaultTheme}>
            <Box sx={{ display: 'flex' }}>
                <CssBaseline />
                <MuiAppBar position="absolute">
                    <Toolbar>
                        <Typography
                            component="h1"
                            variant="h6"
                            color="inherit"
                            noWrap
                            sx={{ flexGrow: 1 }}
                        >
                            SDH Chat
                        </Typography>
                    </Toolbar>
                </MuiAppBar>
                <Drawer variant="permanent">
                    <Toolbar
                        sx={{
                            display: 'flex',
                            alignItems: 'center',
                            justifyContent: 'space-between', // Align items to the left and right
                            px: [1],
                        }}
                    >
                        <Box sx={{ display: 'flex', alignItems: 'center' }}>
                            <Avatar sx={{ marginRight: '10px' }} src="" />
                            <Typography
                                variant="h7"
                                color="inherit"
                                noWrap
                            >
                                Chat
                            </Typography>
                        </Box>
                        <IconButton color="inherit">
                            <LogoutIcon />
                        </IconButton>
                    </Toolbar>
                    <Divider />
                    <List component="nav">
                        {mainListItems}
                    </List>
                </Drawer>
                <Box
                    component="main"
                    sx={{
                        backgroundColor: (theme) =>
                            theme.palette.mode === 'light'
                                ? theme.palette.grey[100]
                                : theme.palette.grey[900],
                        flexGrow: 1,
                        height: '100vh',
                        overflow: 'auto',
                    }}
                >
                    <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
                        <Grid container direction="column" spacing={3}>
                            <Grid item>
                                <Box sx={{ display: 'flex', alignItems: 'center' }}>
                                    <Avatar sx={{ marginRight: '10px' }} src="" />
                                    <Typography
                                        variant="h7"
                                        color="inherit"
                                        noWrap
                                    >
                                        Chat
                                    </Typography>
                                </Box>
                            </Grid>
                            <Grid item xs>
                                {/* Parte del centro para mostrar los mensajes del chat */}
                                <Paper>
                                    <Typography>Mensaje 1</Typography>
                                    <Typography>Mensaje 2</Typography>
                                    {/* Resto de los mensajes */}
                                </Paper>
                            </Grid>
                            <Grid item>
                                {/* Barra inferior con TextField para escribir mensaje y un bot√≥n para enviar mensaje */}
                                <TextField fullWidth variant="outlined" placeholder="Escribe un mensaje" />
                                <Button variant="contained" color="primary">Enviar</Button>
                            </Grid>
                        </Grid>
                    </Container>
                </Box>
            </Box>
        </ThemeProvider>
    );
}
